import React from 'react';
import styled from "styled-components";

const Main = styled.section`
  width: 100vw;
  height: 100vh;
  background: url("./images/home/whykrabi-bg.jpg") center/cover no-repeat;
`

const Home = () => {

    return (
        <>
            <Main />
        </>
    );
}

export default Home;
